import React from 'react';

const AddWordsSection = ({words}) => {


  const renderWords = () => {
    return words.map(word => {
      return (
        <div className="word-to-add btn btn-primary">{word.simplified}</div>
      )
    })
  }

  if (!words) { return <div>Search for words...</div>}

  return (
    <div>
      {renderWords()}
    </div>
  )
}

export default AddWordsSection;
